import React, { useState, useEffect, useCallback } from "react";
import { Button, Form, Container, Row, Col } from "react-bootstrap";
import Web3 from "web3";
import contract from "truffle-contract";
import contractMeta from "../Build/MusicMarketplace.json";
import { create } from "ipfs-http-client";
import axios from "axios";
import logo from "../../src/Assets/logo.png";
// import "../App.css"

const Login = () => {
  const [account, setAccount] = useState("");
  const [ipfs, setIpfs] = useState(null);
  const [username, setUsername] = useState("");
  const [type, setType] = useState("0");
  const [choice, setChoice] = useState("1");

  const web3 = new Web3(Web3.givenProvider || "http://localhost:7545");
  const Contract = contract(contractMeta);
  Contract.setProvider(web3.currentProvider);

  const loginUser = useCallback(async () => {
    let val = "0";
    const contractInstance = await Contract.deployed();
    await contractInstance.checkUserType({ from: account }).then((x) => {
      val = x.toString();
    });
    setType(val);
  }, [account, Contract]);

  useEffect(() => {
    const loadBlockchain = async () => {
      const accounts = await web3.eth.getAccounts();
      setAccount(accounts[0]);
    };

    const loadIPFS = async () => {
      try {
        const JWT = "your_jwt_token_here";
        const response = await axios.get(
          "https://api.pinata.cloud/data/pinList",
          {
            headers: {
              Authorization: `Bearer ${JWT}`,
            },
          }
        );

        const ipfsGatewayUrl = response.data.rows[0].ipfs_pin_hash;
        const conn = create({
          host: ipfsGatewayUrl,
          port: "5001",
          protocol: "https",
        });
        setIpfs(conn);
      } catch (error) {
        console.error("Error loading IPFS:", error);
      }
    };

    loadBlockchain().then(() => console.log("Loaded Blockchain"));
    loadIPFS().then(() => console.log("Loaded IPFS"));
    loginUser().then(() => console.log("Login Successful"));
  }, [loginUser, web3.eth]);

  const registerUser = async (e) => {
    e.preventDefault(); // Prevent form submission
    const contractInstance = await Contract.deployed();
    switch (choice) {
      case "1": // Personal
        await contractInstance
          .addPersonal(username, { from: account })
          .then(() => loginUser());
        break;
      case "2": // Publisher
        await contractInstance
          .addPublisher(username, { from: account })
          .then(() => loginUser());
        break;
      case "3": // Artist
        await contractInstance
          .addArtist(username, { from: account })
          .then(() => loginUser());
        break;
      case "4": // Commercial
        await contractInstance
          .addCommercial(username, { from: account })
          .then(() => loginUser());
        break;
      default:
        console.error("Invalid choice for user type");
    }
  };

  return (
    <>
      <div className="container collector">
        <div className="row">
          <div className="col-md-6 custom-ratio">
            <img className="img-fluid" alt="" src={logo} />
          </div>
          <div className="col-md-6">
            <Container className="">
              <Form onSubmit={registerUser}>
                <h3>Login into your account</h3>
                <Row>
                  <Col>
                    <Form.Group controlId="formBasicType">
                      <Form.Label>User Type</Form.Label>
                      <Form.Control
                        as="select"
                        value={choice}
                        onChange={(e) => setChoice(e.target.value)}
                      >
                        <option value="1">Personal</option>
                        <option value="2">Publisher</option>
                        <option value="3">Artist</option>
                        <option value="4">Commercial</option>
                      </Form.Control>
                    </Form.Group>
                  </Col>
                </Row>
                <Row>
                  <Col>
                    <Form.Group controlId="formBasicUsername">
                      <Form.Label>Username</Form.Label>
                      <Form.Control
                        type="text"
                        placeholder="Enter username"
                        value={username}
                        onChange={(e) => setUsername(e.target.value)}
                      />
                    </Form.Group>
                  </Col>
                </Row>
                <Button variant="primary" type="submit">
                  Submit
                </Button>
              </Form>
            </Container>
          </div>
        </div>
      </div>
    </>
  );
};

export default Login;
